import React, { Component } from 'react'
import { listEmployee } from "../../redux/actions/Employee_list";
import { connect } from 'react-redux';
import { Collapse, Form, Button, Tabs, Layout, Input, TextArea, List } from 'antd';


class EmployeeList extends Component {

    constructor(props) {
        super(props);
        this.state = ({
            data: [this.props.empList]
        });
    }

    componentDidMount() {
        this.props.dispatch(listEmployee())

    }


    render() {
        let ingredients = this.props.data.map((data) => {
            return (<ul key={data.id}><li>{data.name}</li></ul>)
        });
        return (
            <div>
                {ingredients}
            </div>
        )
    }
}
function mapStateToProps(state) {
    return {

        empList: state.empList.result

    };
}
export default connect(mapStateToProps)(EmployeeList);
